pragma solidity 0.8.7;

//------------------------------------------------------------------------------
// MOSTLY TAKEN FROM OPEN ZEPPELIN.
//------------------------------------------------------------------------------
// Has been modified so that only the deployer can initialise the contract.
// This prevents malicious addresses from "stealing" the contract by
// initialising it with incorrect parameters.
//------------------------------------------------------------------------------

/**
 * @dev     This is a base contract to aid in writing upgradeable contracts, or 
 *          any kind of contract that will be deployed behind a proxy. Since a 
 *          proxied contract can't have a constructor, it's common to move 
 *          constructor logic to an external initializer function, usually 
 *          called `initialize`. It then becomes necessary to protect this 
 *          initializer function so it can only be called once. The 
 *          {initializer} modifier provided by this contract will have this 
 *          effect.
 *
 * TIP:     To avoid leaving the proxy in an uninitialized state, the 
 *          initializer function should be called as early as possible by 
 *          providing the encoded function call as the `_data` argument to 
 *          {ERC1967Proxy-constructor}.
 *
 * CAUTION: When used with inheritance, manual care must be taken to not invoke 
 *          a parent initializer twice, or to ensure that all initializers are 
 *          idempotent. This is not verified automatically as constructors are 
 *          by Solidity.
 */
abstract contract Initializable {
    // Indicates that the contract has been initialized.
    bool private initialized_;

    // Indicates that the contract is in the process of being initialized.
    bool private initializing_;

    // Deployer address so that only deployer can initialise preventing 
    // malicious contract initialising.
    address private deployer_;
    // NOTE may need to remove this? Needs more thinking

    constructor() {
        deployer_ = msg.sender;
    }

    /**
     * @dev     Modifier to protect an initializer function from being invoked 
     *          twice. Has been modified so only deployer can initialise. 
     */
    modifier initializer() {
        require(
            initializing_ || !initialized_,
            "Init: Contract is initialized"
        );
        require(msg.sender == deployer_, "Init: Only deployer can init");

        bool isTopLevelCall = !initializing_;

        if (isTopLevelCall) {
            initializing_ = true;
            initialized_ = true;
        }

        _;

        if (isTopLevelCall) {
            initializing_ = false;
        }
    }
}

contracts/Proposals.sol.content:
// SPDX-License-Identifier: MIT
pragma solidity 0.8.7;

import "./BaseSystem.sol";

// QS move to base
interface IExe {
    function getExe(bytes32 _exeID)
        external
        view
        returns (
            address[] memory targets,
            bytes[] memory callData,
            uint256[] memory values
        );

    function createPropExe(
        uint256 _propID,
        bytes32 _exeID,
        string memory _description
    ) external returns (bytes32 propExeID);
}

interface ICoord {
    function getSubSystem(address _system, bytes32 _subIdentifier)
        external
        view
        returns (address);
}

contract Proposals is BaseSystem {

    //--------------------------------------------------------------------------
    // STATE
    //--------------------------------------------------------------------------

    // QS move to base
    enum PropState {
        NotCreated,
        Created,
        ActiveVoting,
        Canceled,
        Defeated,
        Succeeded,
        Queued,
        Expired,
        Executed
    }

    struct Prop {
        string description;
        address voteType;
        bytes32 exeID;
        PropState state;
        uint256 voteStart;
        uint256 voteEnd;
        bool executedOrCanceled;
    }

    mapping(uint256 => Prop) private props_;
    // Exe IDs to related props
    mapping(bytes32 => uint256) private exeToProp_;

    uint256 private propIDCounter_;

    uint256 private voteStartDelay_;
    uint256 private voteEndDelay_;
    uint256 private minDelay_;

    //--------------------------------------------------------------------------
    // EVENTS
    //--------------------------------------------------------------------------

    event NewProposal(uint256 indexed propID, address voteType, bytes32 exeID);

    //--------------------------------------------------------------------------
    // CONSTRUCTOR
    //--------------------------------------------------------------------------

    constructor(address _core) BaseSystem(CoreLib.PROPS, _core) {}

    //--------------------------------------------------------------------------
    // VIEW & PURE FUNCTIONS
    //--------------------------------------------------------------------------

    function getVoteType(uint256 _propID) external view returns (address) {
        return props_[_propID].voteType;
    }

    function getExeOfProp(uint256 _propID) external view returns(bytes32) {
        return props_[_propID].exeID;
    }

    function getPropOfExe(bytes32 _exeID) external view returns(uint256) {
        return exeToProp_[_exeID];
    }

    function getProposalInfo(uint256 _propID) external view returns(
        string memory description,
        address voteType,
        bytes32 exeID,
        PropState state,
        uint256 voteStart,
        uint256 voteEnd,
        bool executedOrCanceled
    ) {
        return (
            props_[_propID].description,
            props_[_propID].voteType,
            props_[_propID].exeID,
            props_[_propID].state,
            props_[_propID].voteStart,
            props_[_propID].voteEnd,
            props_[_propID].executedOrCanceled
        );
    }

    function getPropVotables(uint256 _propID) external view returns(
        PropState state,
        uint256 voteStart,
        uint256 voteEnd,
        bool executedOrCanceled
    ) {
        return(
            props_[_propID].state,
            props_[_propID].voteStart,
            props_[_propID].voteEnd,
            props_[_propID].executedOrCanceled
        );
    }

    //--------------------------------------------------------------------------
    // PUBLIC & EXTERNAL FUNCTIONS
    //--------------------------------------------------------------------------

    function createPropWithExe(
        string calldata _description,
        bytes32 _voteTypeID,
        bytes32 _exeID
    ) external returns (uint256 propID) {
        IExe exeInstance = IExe(core_.getInstance(CoreLib.EXE));
        ICoord coordInstance = ICoord(core_.getInstance(CoreLib.COORD));

        propIDCounter_ += 1;

        propID = propIDCounter_;

        address voteType = coordInstance.getSubSystem(
            core_.getInstance(CoreLib.VOTE_BOOTH),
            _voteTypeID
        );

        require(voteType != address(0), "Prop: Invalid vote type");

        string memory newDescription = string(abi.encodePacked(
            propID, 
            _exeID,
            block.timestamp
        ));

        bytes32 propExeID = exeInstance.createPropExe(
            propID,
            _exeID,
            newDescription
        );

        require(propExeID != bytes32(0), "Prop: Exe does not exist");
        require(
            exeToProp_[propExeID] == 0,
            "Prop: Exe ID already associated"
        );

        uint256 voteStart = block.timestamp + voteStartDelay_;

        props_[propID] = Prop({
            description: _description,
            voteType: voteType,
            exeID: propExeID,
            state: PropState.Created,
            voteStart: voteStart,
            voteEnd: voteStart + voteEndDelay_,
            executedOrCanceled: false
        });
        exeToProp_[propExeID] = propID;

        emit NewProposal(propID, voteType, propExeID);

        // TODO proposal snapshot in vote weight
    }

    //--------------------------------------------------------------------------
    // ONLY CORE
    //
    // Below functions can only be called by this contract. These functions can
    // only be executed by successfully running an executable through the
    // `execute` function.

    /**
     * @param   _newMin The new minimum delay for normal proposals.
     * @notice  This minimum delay counts for both voting starting after a
     *          proposal is proposed, as well as how long the delay is after it
     *          has started till voting closes. Only the core can modify.
     * @dev     These mins are time stamps. The min delay cannot be smaller than
     *          15 (safe minimum).
     */
    function updateMinDelay(uint256 _newMin) external onlyCore {
        require(_newMin > 15, "Prop: min cannot be 0");
        minDelay_ = _newMin;
    }

    /**
     * @param   _startDelay The delay before voting can start on a proposal.
     * @param   _endDelay The delay after voting starts for voting to close.
     * @notice  This minimum delay counts for both voting starting after a
     *          proposal is proposed, as well as how long the delay is after it
     *          has started till voting closes. Only the core can modify.
     * @dev     These mins are time stamps. The min delay cannot be smaller than
     *          15 (safe minimum).
     */
    function updateDelays(
        uint256 _startDelay, 
        uint256 _endDelay
    )
        external
        onlyCore
    {
        require(
            _startDelay >= minDelay_ && _endDelay >= minDelay_,
            "Prop: delays cannot be 0"
        );

        voteStartDelay_ = _startDelay;
        voteEndDelay_ = _endDelay;
    }
}

contracts/Coordinator.sol.content:
// SPDX-License-Identifier: MIT
pragma solidity 0.8.7;

import "./BaseSystem.sol";

interface IProp {
    // QS move to base
    enum PropState {
        NotCreated,
        Created,
        ActiveVoting,
        Canceled,
        Defeated,
        Succeeded,
        Queued,
        Expired,
        Executed
    }

    function getPropVotables(uint256 _propID)
        external
        view
        returns (
            PropState state,
            uint256 voteStart,
            uint256 voteEnd,
            bool executedOrCanceled
        );

    function getPropOfExe(bytes32 _exeID) external view returns(uint256);
}

contract Coordinator is BaseSystem {
    //--------------------------------------------------------------------------
    // STATE
    //--------------------------------------------------------------------------

    mapping(address => mapping(bytes32 => address)) private subSystems_;

    //--------------------------------------------------------------------------
    // CONSTRUCTOR
    //--------------------------------------------------------------------------

    constructor(address _core) BaseSystem(CoreLib.COORD, _core) {}

    //--------------------------------------------------------------------------
    // VIEW & PURE FUNCTIONS
    //--------------------------------------------------------------------------

    /**
     * @param   _exeID ID of the executable to check.
     * @notice  This function will check that the specified proposal has reached
     *          quorum, and that it has passed. If the proposal has not reached
     *          quorum or has not passed this will return false.
     * @dev     The reason we use Exe IDs here and not Prop IDs is that
     *          executables may be valid for execution outside of a proposal
     *          (e.g an approved recurring payment). If the exe is tied to a
     *          proposal the coordinator will be able to look up and verify it's
     *          executable status.
     */
    function isExecutable(bytes32 _exeID) external view returns (bool) {
        IProp propInstance = IProp(core_.getInstance(CoreLib.PROPS));

        uint256 propID = propInstance.getPropOfExe(_exeID);

        // If prop does not exist for this exe then it is not executable
        if(propID == uint256(0)) {
            // FUTURE in later versions one might want to have a list of 
            //        pre-approved exes that can be executed on a recurring 
            //        basis (i.e monthly payments)/
            return false;
        }

        (
            IProp.PropState state,
            uint256 voteStart,
            uint256 voteEnd,
            bool executedOrCanceled
        ) = propInstance.getPropVotables(propID);

        if (
            // State is queued
            state == IProp.PropState.Queued &&
            // AND vote end has passed
            voteEnd > block.timestamp &&
            // AND prop has not been executed or canceled
            !executedOrCanceled
        ) {
            return true;
        }
        // Don't need to return false, will return false if not returning true.
    }

    function isVotable(uint256 _propID) external view returns (bool) {
        IProp propInstance = IProp(core_.getInstance(CoreLib.PROPS));

        (
            IProp.PropState state,
            uint256 voteStart,
            uint256 voteEnd,
            bool executedOrCanceled
        ) = propInstance.getPropVotables(_propID);

        if (
            // State is created or active
            state == IProp.PropState.Created || 
            state == IProp.PropState.ActiveVoting &&
            // AND vote start has passed
            voteStart >= block.timestamp &&
            // AND vote end has not passed
            voteEnd <= block.timestamp &&
            // AND prop has not been executed or canceled
            !executedOrCanceled
        ) {
            return true;
        }
        // Don't need to return false, will return false if not returning true.
    }

    function getSubSystem(address _system, bytes32 _subIdentifier)
        external
        view
        returns (address)
    {
        return subSystems_[_system][_subIdentifier];
    }

    //--------------------------------------------------------------------------
    // PUBLIC & EXTERNAL FUNCTIONS
    //--------------------------------------------------------------------------

    function addSubSystem(
        bytes32 _subIdentifier, 
        address _subImplementation
    )
        external
    {
        bytes32 identifier = BaseSystem(msg.sender).IDENTIFIER();
        address systemRegistered = core_.getInstance(identifier);

        require(msg.sender == systemRegistered, "Coord: Incorrect ID for sub");

        subSystems_[msg.sender][_subIdentifier] = _subImplementation;
    }

    // function execute
    // TODO the core calls when it is going to execute. Will check execution
    // is valid, as well as updating the state to be executed. 
}

